pragma solidity ^0.8.0;

import { LibDiamond } from "../libraries/LibDiamond.sol";
import { LibCurrency } from "../libraries/LibCurrency.sol";
import { LibSaleOrder } from "../libraries/LibSaleOrder.sol";
import { LibNFTContract } from "../libraries/LibNFTContract.sol";
import { LibItem } from "../libraries/LibItem.sol";
import "../utils/math/SafeMath.sol";
import "../interfaces/ISellerFacet.sol";
import "../interfaces/IERC1155.sol";

contract SellerFacet is ISellerFacet{

    using SafeMath for uint256;
    event OrderCancel(address owner,uint256 indexed _orderId);
    event OrderCreated(address owner,uint256 indexed id,address currency,uint256 amount,uint256 price);
    event ItemCreated(uint256 indexed orderId, uint256 itemId,address tokenContract, uint256 tokenId,uint256 amount);

    function sellNFTOneItem(LibDiamond.CreateSaleOrderOneItem calldata param) external override{

        require(param._amount == 1,"INVALID AMOUNT");

        _checkNFTContractIsAllow(param._tokenContract);

        _checkCurrencyIsAllow(param._currency);

        _checkSellerBalance(param._tokenContract,param._tokenId,param._amount,msg.sender);

        uint256 _orderId = _createSaleOrder(param._description, msg.sender, param._currency, param._price,param._amount,param._sellPeriod);

        _addItemToOrder(_orderId,param._tokenContract,param._tokenId,param._amount,param._price,msg.sender);

    }
    function cancelOneOrder(bytes32 _orderCode) external {
        uint256 _orderId = LibSaleOrder._getOrderIdByCode(_orderCode);
        LibDiamond.SaleOrder storage _order = LibSaleOrder._getOrder(_orderId);

        bytes32 _keyMapOrderIdToIndexIsExist = keccak256(abi.encode("USER.ORDER.ID.TO.INDEX.IS.EXIST.ONSELL",msg.sender,_orderId));
        require(LibDiamond.getBool(_keyMapOrderIdToIndexIsExist) == true,"ORDER ID IS NOT EXIST");
        require(_order.owner == msg.sender,"INVALID OWNER ORDER");
        require(_order.status == LibDiamond.OrderStatus.OnSell,"INVALID ORDER STATUS");

        _order.status = LibDiamond.OrderStatus.Cancel;

        bytes32 _keyUserOrdersOnSell = keccak256(abi.encode("USER.ORDER.IDS.ONSELL",msg.sender));
        uint256[] storage _userOrderIds = LibDiamond.getArrayUint(_keyUserOrdersOnSell);

        bytes32 _keyMapOrderIdToIndex= keccak256(abi.encode("USER.ORDER.ID.TO.INDEX.ONSELL",msg.sender,_orderId));

        delete _userOrderIds[LibDiamond.getUint(_keyMapOrderIdToIndex)];

        bytes32 _keyUserOrdersCancel = keccak256(abi.encode("USER.ORDER.IDS.CANCEL",msg.sender));
        uint256[] storage _userOrderIdsCancel = LibDiamond.getArrayUint(_keyUserOrdersCancel);
        _userOrderIdsCancel.push(_orderId);

        LibDiamond.SaleItem memory _item = LibItem._getItemByOrderId(_orderId)[0];
        _decreaseNFTOnSell(_order.owner,_item.tokenContract,_item.tokenId);
        emit OrderCancel(_order.owner,_order.id);

    }
    function _createSaleOrder(string calldata _description,address _owner,address _currency,uint256 _price,uint256 _amount,uint256 _sellPeriod) private returns(uint256){
        LibDiamond.DiamondStorage storage ds = LibDiamond.diamondStorage();
        bytes32 _code = keccak256(abi.encode("ORDER.CODE",ds.orders.length));
        LibDiamond.SaleOrder memory _order = LibDiamond.SaleOrder({
            id: ds.orders.length,
            code: _code,
            description: _description,
            owner: _owner,
            created: block.timestamp,
            currency: _currency,
            amount:_amount,
            totalRemainingForSell:_amount,
            price: _price,
            status: LibDiamond.OrderStatus.OnSell,
            itemCount : 0,
            sellPeriod : _sellPeriod
        });

        _addUserOrdersOnSell(_owner,ds.orders.length);
        emit OrderCreated(_owner,ds.orders.length,_currency,_amount,_price);

        LibSaleOrder._addOrder(_order);

        return ds.orders.length.sub(1);

    }
    function _decreaseNFTOnSell(address _user,address _nftTokenAddress,uint256 _nftTokenId) private {
        bytes32 _keyMapOrderIdToIndex = keccak256(abi.encode("USER.NFT.ID.AMOUNT.ONSELL",_user,_nftTokenAddress,_nftTokenId));
        uint256 _amountUserItemOnSell = LibDiamond.getUint(_keyMapOrderIdToIndex);
        LibDiamond.setUint(_keyMapOrderIdToIndex,_amountUserItemOnSell.sub(1));
    }

    function _addItemToOrder(uint256 _orderId, address _tokenContract, uint256 _tokenId,uint256 _amount,uint256 _price,address _owner) private{
        bytes32 _code = keccak256(abi.encode("ITEM.CODE",_orderId,LibItem._getItemCount()));
        LibDiamond.SaleItem memory _item = LibDiamond.SaleItem({
            id: LibItem._getItemCount(),
            code: _code,
            tokenContract: _tokenContract,
            tokenId: _tokenId,
            amount: _amount,
            orderId: _orderId,
            price: _price
        });
        _increaseNFTOnSell(_owner,_tokenContract,_tokenId);
        emit ItemCreated(_orderId, LibItem._getItemCount(),_tokenContract, _tokenId,_amount);

        LibItem._addItem(_item);
    }

    function _increaseNFTOnSell(address _user,address _nftTokenAddress,uint256 _nftTokenId) private {
        bytes32 _keyMapOrderIdToIndex = keccak256(abi.encode("USER.NFT.ID.AMOUNT.ONSELL",_user,_nftTokenAddress,_nftTokenId));
        uint256 _amountUserItemOnSell = LibDiamond.getUint(_keyMapOrderIdToIndex);
        LibDiamond.setUint(_keyMapOrderIdToIndex,_amountUserItemOnSell.add(1));
    }

    function _getNFTOnSell(address _user,address _nftTokenAddress,uint256 _nftTokenId) private  view returns(uint256){
        bytes32 _keyMapOrderIdToIndex = keccak256(abi.encode("USER.NFT.ID.AMOUNT.ONSELL",_user,_nftTokenAddress,_nftTokenId));
        return LibDiamond.getUint(_keyMapOrderIdToIndex);
    }
    function _addUserOrdersOnSell(address _user,uint256 _orderId) private {
        bytes32 _keyUserOrdersOnSell = keccak256(abi.encode("USER.ORDER.IDS.ONSELL",_user));
        uint256[] storage _userOrderIds = LibDiamond.getArrayUint(_keyUserOrdersOnSell);

        bytes32 _keyMapOrderIdToIndex= keccak256(abi.encode("USER.ORDER.ID.TO.INDEX.ONSELL",_user,_orderId));
        LibDiamond.setUint(_keyMapOrderIdToIndex,_userOrderIds.length);

        bytes32 _keyMapOrderIdToIndexIsExist = keccak256(abi.encode("USER.ORDER.ID.TO.INDEX.IS.EXIST.ONSELL",_user,_orderId));
        LibDiamond.setBool(_keyMapOrderIdToIndexIsExist,true);
        _userOrderIds.push(_orderId);

    }
    function _checkNFTContractIsAllow(address _nftContract) private view{
        require(LibNFTContract._isAllowNFTContract(_nftContract) == true,"INVALID NFT CONTRACT");
    }

    function _checkSellerBalance(address _tokenContract,uint256 _tokenId,uint256 _amount,address _seller) private{     
        uint256 _amountUserBalance = _getSellerBalance(_tokenContract,_tokenId,_seller);   
        uint256 _amountOnSell = _getNFTOnSell(_seller,_tokenContract,_tokenId);

        require(_amount <= _amountUserBalance ,"INVALID AMOUNT");
        require(_amountUserBalance > _amountOnSell,"INVALID AMOUNT");
    }

    function _checkCurrencyIsAllow(address _currency) private view{
        require(LibCurrency._isAllowCurrency(_currency) == true,"INVALID CURRENCY");
    }

    function _getSellerBalance(address _tokenContract,uint256 _tokenId,address _seller) private returns(uint256) {
        return IERC1155(_tokenContract).balanceOf(_seller,_tokenId);
    }

}
